Положение о порядке снижения стоимости обучения.pdf','file','zy267kd6vhytggc4n8gf',NULL,432,'2020-06-23 10:12:41','2020-06-23 10:12:41','pdf'),(463,'Положение о порядке снижения стоимости','yX05HUzsUIpfka9Fo1aNRYQ7AQESXT1ZPV5PMxSs.pdf',3,'Положение о порядке снижения стоимости обучения.pdf','file','kefdnbyl41m5fxy3ztwii',NULL,396,'2020-06-23 10:13:14','2020-06-23 10:13:14','pdf'),(10,'ОБ УТВЕРЖДЕНИИ ПЕРЕЧНЯ ОЛИМПИАД',NULL,0,NULL,'files',NULL,5,NULL,'2020-01-31 10:24:04','2020-02-03 06:25:18',NULL),(12,'Перечень олимпиад','bm7rr2pe3zRpARuiHIfmVM20i9MvnkxnB3KlqVFx.pdf',0,'Перечень олимпиад.pdf','file','a06zmrmrdalee3c2vvt3k7',NULL,10,'2020-01-31 10:25:09','2020-02-03 06:25:18','pdf'),(17,'',NULL,0,'<p>В связи с угрозой распространения новой коронавирусной инфекции (COVID-19)&nbsp;«Дни открытых дверей» институтов и факультетов не проводятся. Интересующую информацию можно найти на сайтах институтов и факультетов (раздел «Университет» по <a href=\"https://mrsu.ru/ru/struct/\" rel=\"noopener noreferrer\" target=\"_blank\">ссылке</a>). Также вы можете задать вопросы на адреса электронной почты соответствующих институтов и факультетов или приемной комиссии университета. </p><p><br></p>','text',NULL,3,NULL,'2020-02-03 06:22:28','2020-06-02 14:03:45',NULL),(18,'ОБ УТВЕРЖДЕНИИ ДОПОЛНИТЕЛЬНОГО ПЕРЕЧНЯ ОЛИМПИАД',NULL,1,NULL,'files',NULL,5,NULL,'2020-02-03 06:25:54','2020-02-03 06:25:54',NULL),(19,'Приказ о доп. перечне олимпиад','v9mPOa78ww28fMXiDd5WH0Qb4kbxcXJ9w00Biwgh.pdf',0,'Приказ о доп. перечне олимпиад.pdf','file','suxhyr665aapln3aff2xur',NULL,18,'2020-02-03 06:25:54','2020-02-03 06:25:54','pdf'),(20,'ПОЛОЖЕНИЯ',NULL,2,NULL,'files',NULL,5,NULL,'2020-02-03 06:27:34','2020-02-03 06:27:34',NULL),(21,' Положение о Открытой олимпиаде по Физике и Химии','YaY0ZkSDWpV9gUi1BzkUQ53ITDkikuTN2IO37RDA.pdf',0,'Положение о Открытой олимпиаде по Физике и Химии.pdf','file','twgnfl71xcnvuh7yne88f',NULL,20,'2020-02-03 06:27:34','2020-02-03 06:27:34','pdf'),(22,'Олимпиада_Машиностроение техни